import React from "react";
import { NavLink } from "react-router-dom";
function Header() {
  const activeStyle = { color: "orange" };
  return (
    <nav>
      <NavLink activeStyle to="./">
        Home
      </NavLink>
      {" | "}
      <NavLink activeStyle to="/course">
        Courses
      </NavLink>
      {" | "}
      <NavLink activeStyle to="/about">
        About
      </NavLink>
    </nav>
  );
}

export default Header;
